index.css:
.speeddial-linear-target {
    min-height: 550px;
    position: relative
}

.speeddial-linear-target .e-fab.e-btn{
    z-index: 99999;
}

.custom-index {
    z-index: 500 !important;
}
/* Represents the styles for icon */
@font-face {
    font-family: 'speeddial-icons';
    src: url(data:application/x-font-ttf;charset=utf-8;base64,) format('truetype');
    font-weight: normal;
    font-style: normal;
}

[class^="speeddial-icon-"],
[class*=" speeddial-icon-"] {
    font-family: 'speeddial-icons' !important;
    speak: none;
    font-style: normal;
    font-weight: normal;
    font-variant: normal;
    text-transform: none;
    line-height: inherit;
    -webkit-font-smoothing: antialiased;
    -moz-osx-font-smoothing: grayscale;
}

.speeddial-icon-upload:before {
    content: "\e706";
}

.speeddial-icon-image:before {
    content: "\e707";
}

.speeddial-icon-audio:before {
    content: "\e708";
}

.speeddial-icon-video:before {
    content: "\e709";
}

